description:
Sean Carruthers of Allmusic said of the compilation, &quot;This is the sound that launched a thousand techno acts.&quot;

Victoria Segal of NME
said, &quot;This fine compilation ... shows Cabaret Voltaire emerging from the gloom of industrial experimentation into the bright lights of proto-house.&quot;

It includes the peerless track &quot;I Want You&quot;.
